import {withRouter} from "react-router-dom";
import React, {Component} from 'react'
import Nav from "../../components/Nav";

class TestHome extends Component{

    render() {
        return <Nav
        title="aaa"
        data={111}
        />;
    }
}

export default withRouter(TestHome)
